import axios from 'axios';

const API_URL = 'http://localhost:3000/api/habitudes';

// Existing exports
export const getAllHabitudes = () => axios.get(API_URL);
export const createHabitude = (habitude) => axios.post(API_URL, habitude);
export const updateHabitude = (id, habitude) => axios.put(`${API_URL}/${id}`, habitude);
export const deleteHabitude = (id) => axios.delete(`${API_URL}/${id}`);

// Add the missing gestionnaireHabitudes export
export const gestionnaireHabitudes = {
  getAllHabitudes: () => axios.get(API_URL),
  createHabitude: (habitude) => axios.post(API_URL, habitude),
  updateHabitude: (id, habitude) => axios.put(`${API_URL}/${id}`, habitude),
  deleteHabitude: (id) => axios.delete(`${API_URL}/${id}`),
  getHabitudeById: (id) => axios.get(`${API_URL}/${id}`)
};
